      '聚龙爱心义工社成立于2013年11月，由一群热心于公益事业的小镇业主组建是一个倡导爱与奉献的公益社团。从最初组织业主学习传统文化、各种爱心捐赠，到创办“爱心简餐”，为小镇业主及游客提供素食，弘扬素食文化，定期组织关爱老人等各项公益活动。',

